import "./Card.css";

const Card = ({ salary, gender, jobHuntDuration }) => {
  return (
    <article className="card">
      <p className="salary">Salary: ${salary}</p>
      <p className="gender">Gender: {gender}</p>
      <p>Job Hunt Duration: {jobHuntDuration} days</p>
    </article>
  );
};

export default Card;
